import React from 'react';
import { Container, Box, Typography, List, ListItem } from '@mui/material';

const Experience = () => {
  return (
    <Box
        style={{
          minHeight: '100vh',
          background: '#EEEEEE',
          display: 'flex',
          justifyContent: 'center', // Center the Container horizontally
        }}
      >
        <Container maxWidth="lg" style={{ display: 'flex', alignItems: 'center' }}>
          {/* Text and content inside the Container */}
          <Box style={{ marginLeft: '5%', width: '100%' }}>
            <Typography variant="h5" color="textSecondary">
              Jack Retterer -
            </Typography>
            <Typography variant="h1" style={{ fontWeight: 'bold' }}>
              currently building
            </Typography>
            <Typography variant="h1" style={{ fontWeight: 'bold' }}>
              (hopefully) cool things.
            </Typography>
          </Box>

          {/* Scroll Down Indicator */}
          <Typography
            style={{
              position: 'absolute',
              bottom: 20,
              right: 20,
              writingMode: 'vertical-rl',
              transform: 'rotate(0deg)',
              cursor: 'pointer',
            }}
            color="textSecondary"
            variant="body1"
            onClick={() => window.scrollTo(0, window.innerHeight)}
          >
            scroll down --->
          </Typography>
        </Container>
      </Box>
  );
};

export default Experience;
